            checkboxP={"ﾂｿAceptas los T&C del servicio?"}
            btnclass={"btn btn-black text-light"}
            btnText="Registrarse"
          />
        </div>
        <DivBar
          Title1={"+300 汳ｻ"}
          p1={"Webs activas."}
          Title2={"4.9 箝申

Valoraciones positivas."}
          Title3={"100% 沒ｴ"}
          p3={"Adaptable a todos los dispositivos."}
        />
        <div >
          <SectionImg
            img2={opiniones}
            pClass={"SectionImg__p"}
            title={"Elegﾃｭ el diseﾃｱo que se adapte a tus necesidades"}
            p={
              "Mﾃ｡s de 100 diseﾃｱos unicos para generar un producto exclusivo,Tambiﾃｩn realizamos diseﾃｱos personalizados para darle mas caracter a tu marca."
            }
            btnClass={"btn btn-dark text-light"}
            button={"Escoge tu plan"}

          />



            <SectionImg
              imgSectImg={"CardHorizontal"}
              pClass="SectionImg__p"
              title={"Cobrar nunca fue tan fﾃ｡cil"}
